inline bool check(int x)
{
//	printf("a:%lld\t", x);
	int u[16] = {};
	int len = 0;
	while(x)
		u[len++] = x%10, x/=10;
	int mx = u[0], mn = u[0];
	for (int i=1; i<len; i++)
		mx = u[i]>mx?u[i]:mx, mn = u[i]<mn?u[i]:mn;
	int b = 0;
	for (int i=len-2; i>=0; i--)
		b = 10*b+u[i];
	if (len)
		b = 10*b+u[len-1];
//	printf("b:%lld\t", b);
	b = b+mn-mx;
//	printf("ans:%lld\t", b);
	int odd_num = 0, even_num = 0;
	while(b)
	{
		if (b&1)	odd_num++;
		else		even_num++;
		b/=10;
	}
//	printf("(%d,%d)\t", odd_num, even_num);
	bool temp =  ((even_num&1) || !(odd_num&1));
//	printf(temp?"Y\n":"N\n");
	return temp;
}

