{
	int t;
	while(1)
	{
		scanf("%d", &t);
		int base;
		for (base=0; base<block && t>sum[base]; base++);
		int left = t-(base>0?sum[base-1]:0);
		base *= block;
		
		int offset;
		for (offset=0; offset<block && left; offset++)
		{
			if (check(base+offset))	left--;
			if (!left)	break;			
		}
		printf("%d\n", base+offset);

	}
}
